  render() {
    const App = () => (
      <div>
        <Switch>
          <Route exact path='/practice'   render={() => (
            <Practice
            //pass the props through the route
              letters={1}
            />
          )}
          exact={true}/>

        </Switch>
      </div>
    )
    return (
      <Switch>

        <App/>
      </Switch>
    );
  }
}

export default App;
